            busdDividedRewardsInContract = busdDividedRewardsInContract.add(tmpBusdDividedRewardsInContract);

            tokensForLpInContract = tokensForLpInContract.add(tmpLpRewardInContract);

            if(automatedMarketMakerPairs[to]) {
